import Header from './components/Header/Header';
import Error404 from './components/Pages/Error404/Error404';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';




function App() {
  return (
    <Router>
    <Header />
    <Routes>

      <Route path='*' element={<Error404 />} />
    </Routes>
  </Router>
  );
}

export default App;
